import jsonimport requestsimport timeclass SendingMusic:    def __init__(self, file_name):        self.file_name = file_name        self.headers = {"Content-Type": "application/json"}        self.url = "http://10.76.69.13:3000/push"        self.logs = []    def last_10(self):        return self.logs[len(self.logs) - 10:]    def sum_logs(self):        count_logs = len(self.logs) % 11        a = len(self.logs) // count_logs        if count_logs == 0:            count_logs += 1        for i in range(0, len(self.logs), count_logs):            for j in range(1, a):                self.logs[i]['size'] += self.logs[j + i]['size']                self.logs[i]['amount'] += self.logs[j + i]['amount']        for i in range(0, count_logs-1):            for j in range(a):                self.logs.pop(i + 1)        return self.logs    def sending(self):        func = self.last_10        times = -1        with open(self.file_name, 'r', encoding='utf-8') as file:            for line in file:                if line == '\n':                    continue                line_split = line.split('|')                if times != int(line_split[0]):                    if times != -1:                        # requests.post(self.url, headers=self.headers, data=json.dumps(func()))                        self.sum_logs()                        # print(func())                        # time.sleep(1)                        self.logs = []                    times = int(line_split[0])                else:                    self.logs.append({                        "amount": len(self.logs),                        "code": int(line_split[3]),                        "size": int(line_split[4])                    })sm = SendingMusic("log.txt")sm.sending()